import React, { useState } from 'react';
import axios from 'axios';

const containerStyle = {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    minHeight: '100vh',
    margin:'20px'
};

const formStyle = {
    maxWidth: '400px',
    padding: '20px 30px', // Adjust padding as needed (top/bottom, right/left)
    border: '1px solid #ccc',
    borderRadius: '5px',
    backgroundColor: '#f4f4f4', // Background color
    boxShadow: '0px 0px 10px rgba(0, 0, 0, 0.1)', // Box shadow for a subtle effect
};


const inputStyle = {
    padding: '10px 20px 10px 10px', // Padding for top, right, bottom, left
    marginBottom: '10px',
    width: '100%',
    border: '1px solid #ccc',
    borderRadius: '3px',
};

const buttonStyle = {
    padding: '10px 20px', // Padding for top/bottom and right/left
    backgroundColor: '#007bff',
    color: '#fff',
    border: 'none',
    borderRadius: '3px',
    cursor: 'pointer',
    width: '100%',
};

function Signup() {
    const [formData, setFormData] = useState({
        email: '',
        password: '',
        username: '',
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();

        try {
            // TODO: Make a POST request to your server to register the user.
            // Use axios or your preferred HTTP client.
            const response = await axios.post('/api/auth/signup', formData);

            // Handle successful registration, redirect user, or show a success message.
            console.log('Registration successful:', response.data);
        } catch (error) {
            // Handle registration errors, display error messages, or handle validation errors.
            console.error('Registration failed:', error.response.data);
        }
    };

    return (
        <div style={containerStyle}>
            <div style={formStyle}>
                <h2>Signup</h2>
                <form onSubmit={handleSubmit}>
                    <div>
                        <label htmlFor="email">Email</label>
                        <input
                            type="email"
                            id="email"
                            name="email"
                            value={formData.email}
                            onChange={handleChange}
                            required
                            style={inputStyle}
                        />
                    </div>
                    <div>
                        <label htmlFor="password">Password</label>
                        <input
                            type="password"
                            id="password"
                            name="password"
                            value={formData.password}
                            onChange={handleChange}
                            required
                            style={inputStyle}
                        />
                    </div>
                    <div>
                        <label htmlFor="username">Username</label>
                        <input
                            type="text"
                            id="username"
                            name="username"
                            value={formData.username}
                            onChange={handleChange}
                            required
                            style={inputStyle}
                        />
                    </div>
                    <button type="submit" style={buttonStyle}>
                        Register
                    </button>
                </form>
            </div>
        </div>
    );
}

export default Signup;
